import { ReaderCategory } from "../../../../../../organisms/constants/CategoryReader" 

function renderCategory(category)
{
    console.log(ReaderCategory.getId(category))

   return (<li key={ReaderCategory.getId(category)} className="side-bar-list flex" onClick={()=> this.setCategoryId(category.id)}>
       <img src={category.image_url} alt = "All" className = "food-image"/>
        <p>{category.display_text}</p>
    </li>)
}
export {renderCategory}
